import React, { Component } from "react";
import Navbar from "../Navbar";
import '../Inthewomb/Inthewomb.css';
import Slider1 from '../images/Inthewomb_banner.jpg';
import Slick1 from '../Inthewomb/Slick1';
import Footer from '../Footer';
// import Week1 from '../images/Pregnancy by week/Week1.jpg';
// import Week2 from '../images/Pregnancy by week/Week2.jpg'
// import Week3 from '../images/Pregnancy by week/Week3.jpg'
// import Week4 from '../images/Pregnancy by week/Week4.jpg'
