// import Week20 from '../images/Pregnancy by week/Week20.jpg'
// import Week21 from '../images/Pregnancy by week/Week21.jpg'
// import Week22 from '../images/Pregnancy by week/Week22.jpg'
// import Week23 from '../images/Pregnancy by week/Week23.jpg'
// import Week24 from '../images/Pregnancy by week/Week24.jpg'
// import Week25 from '../images/Pregnancy by week/Week25.jpg'



function Pregnancybyweek() {
    return (
        <>
<Navbar/>

<div id="carouselExampleCaptions" className="my-carousel carousel slide" data-bs-ride="carousel"> 
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img src={Slider1} className="d-block w-100" height="100%" alt="..."/>
            <div className="carousel-caption d-none d-md-block">
              <h5>In The Womb</h5>
              <p>Get Updates on baby's development, decode your pregnancy Symptoms and see your weekly to-dos.</p>
              {/* <div className="slider-btn">
                  <button className="btn btn-1">Read More</button>
              </div> */}
            </div>
          </div>  
        </div>
      </div>


      <div class="cards-list">

  <div class="card 1">
    <div class="card_image"> <img src="https://i.redd.it/b3esnz5ra34y.jpg" /> </div>
    <div class="card_title title-white">
      <p>Card Title</p>
    </div>
  </div>

    <div class="card 2">
    <div class="card_image">
      <img src="https://cdn.blackmilkclothing.com/media/wysiwyg/Wallpapers/PhoneWallpapers_FloralCoral.jpg" />
      </div>
    <div class="card_title title-white">
      <p>Card Title</p>
    </div>
  </div>

  <div class="card 3">
    <div class="card_image">
      <img src="https://media.giphy.com/media/10SvWCbt1ytWCc/giphy.gif" />
    </div>
    <div class="card_title">
      <p>Card Title</p>
    </div>
  </div>

    <div class="card 4">
    <div class="card_image">
      <img src="https://media.giphy.com/media/LwIyvaNcnzsD6/giphy.gif" />
      </div>
    <div class="card_title title-black">
      <p>Card Title</p>
    </div>
    </div>

  </div>
      <Footer />
</>
    );
}

export default Pregnancybyweek;
